function iterateByLine(s)
	if s:sub(-1)~="\n" then s=s.."\n" end
	return s:gmatch("(.-)\n")
end

function findCommonCharacter(a, b)
	for i = 1, a:len() do
		local char = a:sub(i, i)
		if b:find(char) then
			return char
		end
	end
end

function getPriority(letter)
	if (letter == string.lower(letter)) then
		return string.byte(letter) - 96
	else
		return string.byte(string.lower(letter)) - 70
	end
end

local sum = 0

for line in iterateByLine(input) do


	local firstHalf = line:sub(1, line:len() / 2)
	local secondHalf = line:sub(line:len() / 2 + 1)

	local commonChar = findCommonCharacter(firstHalf, secondHalf)

	local priority = getPriority(commonChar)

	sum = sum + priority

	print(firstHalf, " -- ",secondHalf)
	print(commonChar, priority)

end

print("Sum: ", sum)
